import React from "react";
import {View, StyleSheet, Text} from 'react-native'

const ScreenTemplate = () => {
  return (
    <View style={styles.maincontainor} >
        <View style={styles.header}>
            <Text>Happy Monday!</Text>
        </View>
        <View style={styles.containor}>
            <View style={styles.nameTage}></View>
            <View style={styles.spaceTaker}></View>
        </View>
        <View style={styles.bcontainor}>
            <View style={styles.bspaceTaker}></View>
            <View style={styles.catDialog}></View>
        </View>
        <View style={styles.cat}></View>
        <View style={styles.catfood}></View>
        <View style={styles.footer}></View>
    </View>
  )
}

const styles = StyleSheet.create({
    maincontainor: {
        flex: 1,
        flexDirection: 'column',
    },
    header: {
        flex: 3,
        alignContent: 'center',
        backgroundColor: 'red',
    },
    containor: {
        flex: 1,
        flexDirection: 'row',
        backgroundColor: 'blue',
    },
    nameTage: {
        flex: 2,
        backgroundColor: 'black',
    },
    spaceTaker: {
        flex: 3,
        backgroundColor: 'brown'
    },
    bcontainor: {
        flex: 1,
        flexDirection: 'row',
        backgroundColor: 'green'
    },
    catDialog: {
        flex: 3,
        backgroundColor: 'pink'
    },
    bspaceTaker: {
        flex: 2,
        backgroundColor: 'purple'
    },
    cat: {
        flex: 7,
        backgroundColor: 'orange',
    },
    catfood: {
        flex: 2,
        backgroundColor: 'yellow'
    },
    footer: {
        flex: 2,
        backgroundColor: 'grey'
    },
})


export default ScreenTemplate
